Column.Formula:
LET $current := ARRAY([EFormType], [RecordID]);
LET $descriptionColumns := 
HASH(
	"Contract",  					"Contract Number", 
	"Vendor", 						"Company Name",
	"Procurement", 					"Procurement Number",
	"Project", 						"Project Number",
    "Evaluation", 		    		"Description",
  	"Information Request",  		"File No.", 
	"Subpoena", 					"File No.",
	"Privacy Incident", 			"File No."
); 

LET $altFormName:= HASH(
  	"Insurance",	"Compliance"
  );

LET $getLabelText := $(eFormType, recordID)
(
  	LET $targetColumn := HASH_GET($descriptionColumns, $eFormType);
  	RETURN 
  	IF( $targetColumn = NULL, NULL,
		LET $isthisRecord := ARRAY($eFormType, $recordID) = $current;
		LET $title:= 
		IF( $isthisRecord = TRUE, 
			CURRENT_VALUE($targetColumn),
			ARRAY_FIRST(DB_LOOKUP(
				ARRAY($targetColumn),
				$eFormType, 
				"[RecordID] FAST_EQUAL_TO " & $recordID
			))
		  );
		//shortern the descriptive label/ title
		LET $charCount := LEN($title);
		LET $titleArray := SPLIT($title, " ");
		LET $wordCount := ARRAY_LENGTH($titleArray);

		LET $charLimit := 30; 
		LET $wordLimit := ARRAY_LENGTH( SPLIT( LEFT($title, $charLimit), " ") );

	  RETURN //ARRAY_TAKE($titleArray, $wordLimit)
		IF(
			$wordCount <= $wordLimit, $title,
			ARRAY_JOIN(
				ARRAY_TAKE($titleArray, $wordLimit), " "
			)& " ..."
		)
	  )

); 

LET $getReadAccess := $(eFormType, recordID)
( EBMS_GET_EFORMRECORD_PERMISSION($eFormType, $recordID, "read"));

LET $currentDes := CALL($getLabelText, [EFormType], [RecordID]);
LET $currentAccess := FALSE;

RETURN
IF(
	[Parent Structure] <> NULL, [Parent Structure],
  	(

	  LET $parent := 
	  IF( 
		[RecordID] > 0, 
		(
		  LET $record := EBMS_GET_PARENT_RECORD(ARRAY_FIRST($current), ARRAY_INDEX($current, 2));
		  RETURN 
			  IF(  ARRAY_FIRST($record) == NULL, NULL,
				ARRAY_CONCAT( 
				  $record, 
				  CALL($getLabelText, ARRAY_FIRST($record), ARRAY_INDEX($record, 2)),
				  CALL($getReadAccess, ARRAY_FIRST($record), ARRAY_INDEX($record, 2))
				  )

			  )
	  )); 

	  LET $gParent := 
	  IF( 
		 $parent <> NULL, 
		(
		  LET $record := EBMS_GET_PARENT_RECORD(ARRAY_FIRST($parent), ARRAY_INDEX($parent, 2));
		  RETURN 
			  IF(  ARRAY_FIRST($record) == NULL, NULL,
				ARRAY_CONCAT( 
				  $record, 
				  CALL($getLabelText, ARRAY_FIRST($record), ARRAY_INDEX($record, 2)),
				  CALL($getReadAccess, ARRAY_FIRST($record), ARRAY_INDEX($record, 2))
			  )
		  )
	  )); 

	  LET $hash :=  
	  HASH_MERGE(
		  IF( $parent <> NULL, HASH("parent", 	$parent)),
		  IF( $gParent <> NULL, HASH("gparent", 	$gParent))
	  );

	  LET $parentStructure := 	//2nd instance
	  IF( 
		  ARRAY_LENGTH(HASH_KEYS($hash)) >0, $hash, NULL
	  );

	  LET $parentData:= 
	  ARRAY_WHERE(
		ARRAY(
			$gParent, 
			$parent, 
			ARRAY_CONCAT($current, $currentDes, $currentAccess),
		), $(i,item) $item <> NULL
	   );


	  LET $parentChain:=
		ARRAY_SELECT(
			  $parentData, $(i, item)
			  ARRAY_TAKE($item, 2)
	   );


	  LET $parentLinks :=
	  ARRAY_SELECT(
		  $parentData, $(i, item) 
			  LET $eFormType 		:= ARRAY_FIRST($item);
			  LET $recordID 		:= ARRAY_INDEX($item, 2);
			  LET $descriptiveLabel := ARRAY_INDEX($item, 3);
			  LET $hasReadAccess	:= ARRAY_INDEX($item, 4);
			  LET $URL	:= "records/" & URLENCODE($eFormType) & "/" & $recordID ;
			  LET $showEFormType := $eFormType <> "Vendor";

			  LET $labelColour := 
				  IF(
				   AND($eFormType = [EFormType], $recordID = [RecordID]),
					  "background: #ffffff; color: #5D5D5D;",
					 $hasReadAccess = TRUE,
					  "background: #ffffff; color: #4D87B7;",
					  "background: #ffffff; color: #5D5D5D;"

				  );



			  LET $labeltext:= 
					  IF( $showEFormType == TRUE, " " & COALESCE(HASH_GET($altFormName, $eFormType), $eFormType) ) &
					  IF(NOT(ISBLANK($descriptiveLabel)), " " & $descriptiveLabel);

			  LET $label :=  
				  "<span style=""margin-left: 5px;" & $labelColour & """>" &
				  HTMLENCODE($labeltext) & 
				  "</span>";

			  RETURN 
			  IF( 
				  $hasReadAccess == TRUE, 
				  "<a style=""text-decoration-line: none;"" href=" & HTMLENCODE($URL) & ">" & $label & "</a>",
				  $label 
			  )
	  );

	   LET $separator :=   "<svg style=""vertical-align: bottom; margin-left: 5px; height: 18px;"" xmlns=""http://www.w3.org/2000/svg"" viewBox=""0 0 256 512""><path fill=""#5D5D5D"" d=""M246.6 278.6c12.5-12.5 12.5-32.8 0-45.3l-128-128c-9.2-9.2-22.9-11.9-34.9-6.9s-19.8 16.6-19.8 29.6l0 256c0 12.9 7.8 24.6 19.8 29.6s25.7 2.2 34.9-6.9l128-128z""/></svg>";

	  LET $breadcrumb := "<div style=""height: 23px; padding-left: 5px; font-size: 10pt; color: #5D5D5D; "">You are here:" & ARRAY_JOIN($parentLinks, $separator) & "</div>";

	  RETURN 
	  HASH(
		  "Parent Structure",	$parentStructure,
		  "Parent Data", 		$parentData,
		  "Parent Chain",		$parentChain,
		  "Breadcrumb",		$breadcrumb
		)
	 )
)

FieldEntry.Formula:
//Variables
LET $prefix := HASH_GET($eventargs, "Contract Number Prefix");  
LET $useFYPrefix := HASH_GET($eventargs, "Use Current Financial Year Prefix");
LET $useCYPrefix := HASH_GET($eventargs, "Use Current Year Prefix");
LET $onlyCountCY := HASH_GET($eventargs, "Only Count Current Year");
LET $typeNumbering := HASH_GET($eventargs, "Contract Type Numbering");

LET $typeShortName := 
IF( 
  $typeNumbering == TRUE,
    DB_LOOKUP("Short Name", "Contract Type", "[Name] FAST_EQUAL_TO " & DB_ENCODECONSTANT([Contract Type]))
); 

//Build a Filter
LET $now := NOW(); 
LET $startOfCY := DATE(YEAR($now));
LET $startOfFY := EBMS_GET_FINANCIAL_YEAR_START($now);

LET $financialYearFilter := " AND [DateCreated] >= " & DB_ENCODECONSTANT($startOfFY);
LET $calendarYearFilter := " AND [DateCreated] >= " & DB_ENCODECONSTANT($startOfCY);
LET $typeFilter := 
" AND ([Contract Type] = " & DB_ENCODECONSTANT([Contract Type]) & " OR [Contract Type Short Name] = " & 
DB_ENCODECONSTANT($shortname) & ")";

LET $filter := 
"[RecordID] < " & [RecordID] &
(
  IF( 
    AND(
      $onlyCountCY == TRUE,
      $useFYPrefix == TRUE
    ),
    $financialYearFilter
  ) & 
  IF( 
    AND(
      $onlyCountCY == TRUE,
      $useCYPrefix == TRUE
    ),
    $calendarYearFilter
  ) & 
  IF( 
    $typeNumbering == TRUE,
    $typeFilter
  )
);

//Get most recent allocated number for this sequence type
LET $highestRecentAllocatedNumber := 
DB_LOOKUP(
  "Allocated Number", 
  "Contract Number",
  $filter & " AND [Allocated Number] IS NOT NULL", 
  HASH("sort", "[Allocated Number] DESC")
); 

//Generate a new number
LET $newNumberAttempts := $(startingNumber, numberOfAttempts)
(
  ARRAY_SELECT(
    RANGE($startingNumber, $numberOfAttempts), $(i, item)
    LET $allocated := $highestRecentAllocatedNumber + $item;
    LET $formatted := 
    (
  	  LET $prefixNumber := $typeShortName & $allocated; 

  	  LET $yearPrefixNumber := 
  	  IF(
  		$useCYPrefix = TRUE,
  		YEAR($now) & "-" & $prefixNumber,

  		$useFYPrefix = TRUE,
  		RIGHT(FINANCIALYEAR($now) - 1, 2) & "/" & RIGHT(FINANCIALYEAR($now), 2) & "-" & $prefixNumber, 

		$prefixNumber
  	  ); 

  	  RETURN 
	  $prefix & 
	  $yearPrefixNumber
  	);

    LET $distinct := DB_LOOKUP("Contract Number", "Contract", HASH("Contract Number", $formatted)) = NULL;

    RETURN 
    IF(
  	  $distinct = TRUE, 
  	  HASH(
  	    "Allocated", $allocated,
  	    "Formatted", $formatted,
  	    "Distinct", TRUE, 
		"HighestAllocatedNumber", $highestRecentAllocatedNumber,
		"Filter", $filter
  	  )
    )
  )
); 

LET $extractFirstDistinct := $(arrayOfAttempts)(
  ARRAY_FIRST(ARRAY_WHERE($arrayOfAttempts, $(i, item) $item <> NULL))
); 

LET $distinctNumberHash1 := CALL($extractFirstDistinct, CALL($newNumberAttempts, 1, 1)); //try one number
//LET $distinctNumberHash2 := IF($distinctNumberHash1 = NULL, CALL($extractFirstDistinct, CALL($newNumberAttempts, 2, 5))); //try 4 more numbers
//LET $distinctNumberHash3 := IF($distinctNumberHash2 = NULL, CALL($extractFirstDistinct, CALL($newNumberAttempts, 6, 10))); //try a bunch more times

RETURN COALESCE($distinctNumberHash1, $distinctNumberHash2, $distinctNumberHash3)
